    bool public isPublicSaleActive = false;

    bool public isMintListSaleActive = false;

    // TODO: TBD if these will be different prices
    uint public publicSalePrice;
    uint public mintListSalePrice;

    // TODO: either set this when we toggle public sale or hard code
    uint public MAX_SUPPLY = 10000;
    uint public MAX_PER_TX_PUBLIC_SALE = 2; // TBD
    uint public MAX_PER_TX_MINT_LIST_SALE = 1; // TBD

    uint public maxSupplyMintListSale;

    bytes32 public mintListMerkleRoot;

    string public baseURI;

    // Storage of addresses that have minted the mint list sale
    mapping(address => bool) public mintListSaleParticipants;
    // Public sale participants
    // TODO: remove? Allow people to mint multiple times in public sale?
    mapping(address => bool) public publicSaleParticipants;

    constructor(uint _publicSalePrice,
        uint _mintListSalePrice,
        uint _maxSupplyMintListSale
    ) ERC721("NexusPortalPass", "NEXUS") {
        publicSalePrice = _publicSalePrice;
        mintListSalePrice = _mintListSalePrice;
        maxSupplyMintListSale = _maxSupplyMintListSale;
    }

    function setMaxSupplyMintListSale(uint _maxSupplyMintListSale) external onlyOwner {
        maxSupplyMintListSale = _maxSupplyMintListSale;
    }

    function setPublicSaleActive(bool _isActive) external onlyOwner {
        isPublicSaleActive = _isActive;
    }

    function setMintListSaleActive(bool _isActive) external onlyOwner {
        isMintListSaleActive = _isActive;
    }

    function setMintListMerkleRoot(bytes32 _mintListMerkleRoot) external onlyOwner {
        mintListMerkleRoot = _mintListMerkleRoot;
    }

    function setBaseURI(string calldata _baseURI) external onlyOwner {
        baseURI = _baseURI;
    }

    function setPublicSalePrice(uint256 _publicSalePrice) public onlyOwner {
        publicSalePrice = _publicSalePrice;
    }

    function setMintListSalePrice(uint256 _mintListSalePrice) public onlyOwner {
        mintListSalePrice = _mintListSalePrice;
    }

    function claim(uint256 _amount) external payable {
        uint256 supply = totalSupply();

        require(isPublicSaleActive, 'Public sale is not active');
        require(tx.origin == msg.sender, 'Only EOAs can mint');
        require(supply + _amount < MAX_SUPPLY, 'Maximum minted for public sale');
        require(_amount < MAX_PER_TX_PUBLIC_SALE, 'Mint amount not allowed');
        require(!publicSaleParticipants[msg.sender], 'Mint already claimed');
        require(msg.value >= publicSalePrice * _amount, 'Ether amount denied');

        // TODO: should we limit each public address from minting only once?
        publicSaleParticipants[msg.sender] = true;

        for (uint256 i; i < _amount; i++) {
            _safeMint(msg.sender, supply + i);
        }
    }

    function mintListClaim(bytes32[] calldata _merkleProof, uint256 _amount) external payable {
        uint256 supply = totalSupply();
        // TODO: website side create sig from multiple params? amount etc
        bytes32 leaf = keccak256(abi.encodePacked(msg.sender));

        require(isMintListSaleActive, 'Mint list sale is not active');
        require(tx.origin == msg.sender, 'Only EOAs can mint');
        //require(supply + _amount < MAX_SUPPLY_MINT_LIST_SALE, 'Maximum minted for mint list sale');
        require(_amount < MAX_PER_TX_MINT_LIST_SALE, 'Mint amount not allowed');
        require(!mintListSaleParticipants[msg.sender], 'Mint already claimed');
        require(msg.value >= mintListSalePrice * _amount, 'Ether amount denied');
        require(MerkleProof.verify(_merkleProof, mintListMerkleRoot, leaf), 'Invalid proof');

        mintListSaleParticipants[msg.sender] = true;

        for (uint256 i; i < _amount; i++) {
            _safeMint(msg.sender, supply + i);
        }
    }

    // TODO: set it so this can only execute once?
    function mintForTeam(uint n) public onlyOwner {
        uint supply = totalSupply();
        for (uint i = 0; i < n; i++) {
            _safeMint(msg.sender, supply + i);
        }
    }

    // Send balance of contract to vault address
    function withdraw() public onlyOwner {
        uint256 balance = address(this).balance;
        payable(msg.sender).transfer(balance);
    }
}

